    @Test
    public void entradaESaidaManual() throws IOException {
        inicioExecucao = new DateTime(2016, 12, 24, 13, 59, 0);
        controlador = getControlador();
        Motor motor = new Motor(controlador, inicioExecucao, this);

        avancarSegundos(motor, 100);
        acionarModoManual(motor);
        avancarSegundos(motor, 30);
        trocarEstagioModoManual(motor);
        avancarSegundos(motor, 500);

        assertTrue(ativacaoModoManual.get(inicioExecucao.plusSeconds(100)));
        assertTrue(desativacaoModoManual.get(inicioExecucao.plusSeconds(156)));

        assertEquals("Estagio atual", 2, listaEstagios.get(inicioExecucao.plusSeconds(130)).get(1).getEstagio().getPosicao().intValue());
        assertEquals("Estagio atual", 2, listaEstagios.get(inicioExecucao.plusSeconds(130)).get(2).getEstagio().getPosicao().intValue());
        assertEquals("Estagio atual", 2, listaEstagios.get(inicioExecucao.plusSeconds(130)).get(3).getEstagio().getPosicao().intValue());
        assertEquals("Estagio atual", 2, listaEstagios.get(inicioExecucao.plusSeconds(130)).get(4).getEstagio().getPosicao().intValue());

    }

